import request from '@/utils/request';
export default {
  wxPrepare: function wxPrepare(params) {
    return request({
      url: '/pay/wx/prepare',
      method: 'post',
      params: params
    });
  },
  wxPay: function wxPay(userName) {
    var params = {
      userName: userName
    };
    return request({
      url: '/user/updateUserName/',
      method: 'post',
      params: params
    });
  },
  queryResult: function queryResult(orderSn) {
    return request({
      url: '/pay/queryResult/' + orderSn,
      method: 'get'
    });
  }
};
